  "text" : "\uC774 \uBB38\uC81C\uB294 \uD559\uACC4\uC5D0\uC11C \uC5F0\uAD6C\uB418\uACE0 \uC788\uB294 \uC720\uAE30\uC9D5\uC5ED\uD615\uC758 \uD6A8\uACFC\uC801\uC778 \uC9D1\uD589\uACFC \uB610 \uAD50\uD654\uBC29\uC548\uACFC \uD568\uAED8 \uB17C\uC758 \uB418\uC5B4\uC57C \uD560 \uBB38\uC81C\uC774\uC9C0 \uB530\uB85C \uB5BC\uC5B4\uC11C \uC0DD\uAC01\uD560 \uAC83\uC774 \uC544\uB2D9\uB2C8\uB2E4. \uBC95\uC815\uD615\uC774 \uC9C0\uB098\uCE58\uAC8C \uBB34\uAC81\uAC8C \uB418\uBA74 \uD5CC\uBC95\uC0C1 \uBE44\uB840\uC758 \uC6D0\uCE59\uC5D0 \uC5B4\uAE0B\uB098\uACE0 \uD615\uC0AC\uC815\uCC45\uC0C1\uC73C\uB85C\uB3C4 \uBC95\uC758 \uC815\uB2F9\uC131\uC744 \uC783\uAC8C \uB429\uB2C8\uB2E4.",
