  "text" : "\uD615\uC0AC\uC815\uCC45\uC0C1 \uC62C\uBC14\uB978 \uBC29\uD5A5\uC774 \uC544\uB2D9\uB2C8\uB2E4.\n\n\uBAA8\uB4E0 \uBC94\uC8C4\uC5D0 \uB300\uD574\uC11C \uC0C1\uD55C\uC744 \uB192\uC77C \uD544\uC694\uAC00 \uC5BC\uB9C8\uB098 \uC788\uACA0\uC2B5\uB2C8\uAE4C? \uC0C1\uD55C\uAC00\uC911\uC758 \uC815\uB3C4\uB294 \uD615\uBC8C\uCCB4\uACC4\uB97C \uACE0\uB824\uD574\uC11C \uC885\uD569\uC801\uC73C\uB85C \uAC80\uD1A0\uD560 \uD544\uC694\uAC00 \uC788\uB294\uB370 \uC6B0\uB9AC \uBC95\uCCB4\uACC4\uC778 \uB300\uB959\uBC95\uACC4\uC778 \uB3C5\uC77C\uC758 \uACBD\uC6B0\uB3C4 \uC720\uAE30\uC9D5\uC5ED\uD615 \uC0C1\uD55C\uC744 15\uB144\uC73C\uB85C \uD558\uACE0 \uC788\uC2B5\uB2C8\uB2E4.",
