  "text" : "\uD2B9\uBCC4\uD55C \uB300\uCC45 \uC5C6\uC774 \uBC94\uC8C4\uC790\uC5D0 \uB300\uD55C \uC751\uBCF4\uC8FC\uC758\uC640 \uC911\uD615\uC8FC\uC758\uC5D0 \uAE30\uB300\uC5B4\uC11C \uD615\uB7C9\uC744 \uB192\uC774\uB294 \uAC83\uC740 \uB300\uC548\uC774 \uB420 \uC218 \uC5C6\uC2B5\uB2C8\uB2E4. \uC774\uB85C\uC368 \uAD6D\uAC00\uAC00 \uAD50\uD654\uC758 \uC758\uBB34\uB97C \uBAA8\uBA74\uD560 \uC218 \uC5C6\uB294 \uAC83\uB3C4 \uBD84\uBA85\uD569\uB2C8\uB2E4. \uC774 \uAC1C\uC815\uC548\uC740 \uCD5C\uADFC\uC5D0 \uC544\uB3D9 \uC131\uBC94\uC8C4\uC5D0 \uB300\uD55C \uAC15\uACBD\uCC98\uBC8C \uC5EC\uB860\uC5D0 \uAE30\uB300\uC5B4 \uC81C\uCD9C\uB41C \uAC83\uC73C\uB85C\uC11C",
