  "text" : "\uAC15\uD55C \uD615\uBC8C\uC744 \uB54C\uB9AC\uB294 \uAC83\uC774 \uC815\uC758\uB77C\uACE0 \uBBFF\uB294\uB2E4\uBA74, \uBB50 \uADF8\uAC83\uB3C4 \uC5B4\uB5A4 \uCE21\uBA74\uC5D0\uC11C\uB294 \uBD80\uB7EC\uC6B4 \uB9C8\uC778\uB4DC..\n\n\uD53C\uD574\uC790\uC640 \uC720\uC871\uB4E4\uC774 \uC190\uD574\uBC30\uC0C1\uC73C\uB85C \uAC00\uD574\uC790\uC758 \uC5F0\uAE08 \uB2E4 \uC2A4\uD2F8\uD558\uACE0, \uAD6D\uAC00\uC5D0\uAE4C\uC9C0 \uCC45\uC784\uC744 \uBB3C\uC744 \uC218 \uC788\uAC8C \uB418\uB294 \uB4F1\uC758 \uD604\uC2E4\uC801 \uD574\uACB0\uCC45\uB4E4\uC740 \uC911\uC694\uCE58  \uC54A\uB2E4. \uADF8\uC800 \uB2E5\uCE58\uACE0 \uADF9\uD615\uC774 \uC815\uC758",
