  "text" : "\uBCF4\uACE0\uB41C \uBC14 \uC788\uB2E4. \uC774\uB7F0 \uC5F0\uAD6C\uB4E4\uC740 \uBAA8\uB450 \uD3ED\uD589, \uAC15\uAC04, \uC0B4\uC778 \uB4F1 \uAC15\uB825\uBC94\uC8C4\uC758 70%\uAC00 \uB2E8\uC9C0 5-6%\uC758 \uC0AC\uB78C\uB4E4\uC5D0 \uC758\uD574 \uC800\uC9C8\uB7EC\uC84C\uB2E4\uB294 \uC5F0\uAD6C \uACB0\uACFC\uC5D0\uC11C \uCD9C\uBC1C\uD55C\uB2E4. \uB2E4\uC2DC \uB9D0\uD574 \uD3ED\uB825\uC744 \uC800\uC9C0\uB974\uB294 \uC18C\uC218\uC758 \uC0AC\uB78C\uB4E4\uC740 \uC0DD\uBB3C\uD559\uC801\uC73C\uB85C \uC6B0\uB9AC\uC640\uB294 \uB2E4\uB978 \uC0AC\uB78C\uB4E4\uC77C \uAC83\uC774\uB77C\uB294 \uAC00\uC815\uC774\uB2E4",
