  "text" : "\uC788\uC5C8\uC73C\uBA70, \uC774\uB4E4\uC774 \uC800\uC9C0\uB978 \uD3ED\uB825\uD589\uC704\uB294 \uC804\uCCB4 \uD3ED\uB825\uC758 44%\uB97C \uCC28\uC9C0\uD588\uB2E4\uACE0 \uBC1D\uD614\uB2E4.\n\n\uC774\uBFD0\uB9CC\uC774 \uC544\uB2C8\uB2E4. \uD3ED\uB825\uC801\uC778 \uB0A8\uC131\uB4E4\uC758 \uACBD\uC6B0 \uD14C\uC2A4\uD1A0\uC2A4\uD14C\uB860\uC774\uB77C\uB294 \uC131\uD638\uB974\uBAAC\uC744 \uACFC\uB2E4 \uBD84\uBE44\uD55C\uB2E4\uB294 \uB17C\uBB38\uC774 \uB4F1\uC7A5\uD558\uB294\uAC00 \uD558\uBA74, \uD3ED\uB825\uC801\uC778 \uC0AC\uB78C\uC77C\uC218\uB85D \uC138\uB85C\uD1A0\uB2CC \uD638\uB974\uBAAC \uC218\uCE58\uAC00 \uB0AE\uB2E4\uB294 \uC5F0\uAD6C \uACB0\uACFC\uB3C4",
