  "text" : "\uAD00\uC5EC\uD558\uB294 \uAC83\uC73C\uB85C \uC54C\uB824\uC838 \uC788\uB2E4. MAOA\uC758 \uC218\uCE58\uAC00 \uB0AE\uC744 \uACBD\uC6B0 \uAC10\uC815 \uC870\uC808\uC774 \uC81C\uB300\uB85C \uC774\uB904\uC9C0\uC9C0 \uC54A\uC544 \uBC18\uC0AC\uD68C\uC801 \uD589\uC704\uB97C \uC800\uC9C0\uB97C \uD655\uB960\uC774 \uB192\uB2E4\uB294 \uAC83\uC774\uB2E4. \uADF8\uB4E4\uC758 \uC870\uC0AC\uC5D0 \uB530\uB974\uBA74, \uC804\uCCB4 \uB300\uC0C1 4\uBC3142\uBA85 \uC911 12%\uAC00 \u2018\uB0AE\uC740 MAOA \uC218\uCE58\u2019\uB97C \uB9CC\uB4E4\uC5B4\uB0B4\uB294 \uC720\uC804 \uD615\uC9C8\uC744 \uAC16\uACE0",
