  "text" : "\uC5F0\uAD6C\uC9C4\uC740 1972\uB144 \uB274\uC9C8\uB79C\uB4DC \uB2E4\uB2C8\uB518\uC5D0\uC11C \uCD9C\uC0DD\uD55C \uC18C\uB144 4\uBC3142\uBA85\uC758 \uC131\uC7A5\uACFC\uC815\uC744 26\uB144 \uAC04 \uAD00\uCC30\u2219\uBD84\uC11D\uD574 \uC774\uAC19\uC740 \uACB0\uB860\uC744 \uB0B4\uB838\uB2E4. \uBB38\uC81C\uC758 \uC720\uC804\uC790\uB294 \uBAA8\uB178\uC544\uBBFC \uC0B0\uD654\uD6A8\uC18C(MAOA)\uC758 \uC591\uC744 \uC870\uC808\uD558\uB294 \uC720\uC804\uC790\uC778\uB370, MAOA\uB294 \uB1CC \uC18D\uC5D0\uC11C \uAC10\uC815\uC744 \uC804\uB2EC\uD558\uB294 \uD654\uD559\uBB3C\uC9C8\uC744 \uB9CC\uB4DC\uB294\uB370",
