  "text" : "(\uC911\uB7B5)\u2026 \uB1CC\uD30C \uC815\uBCF4\uB9CC\uC73C\uB85C \uC2DC\uAC01 \uC601\uC0C1\uC744 \uAD6C\uC131\uD55C\uB2E4\uB294 \uBC29\uBC95\uC740 \uBD88\uAC00\uB2A5\uD560 \uBFD0 \uC544\uB2C8\uB77C, \uC608\uC9C0\uC790 \uB9C8\uB2E4 \uC0AC\uAC74\uC744 \uBC14\uB77C\uBCF4\uB294 \uAD00\uC810\uC774 \uC11C\uB85C \uB2E4\uB974\uAE30 \uB54C\uBB38\uC5D0 \uD558\uB098\uC758 \uC77C\uAD00\uB41C \uC601\uC0C1\uC744 \uC5BB\uAE30\uB294 \uC5B4\uB824\uC6B8 \uAC83\uC774\uB2E4. \uC774\uAC83\uC740 \uBC94\uC8C4\uC608\uCE21 \uC2DC\uC2A4\uD15C\uC758 \uC815\uD655\uB3C4\uC640 \uC9C1\uACB0\uB41C \uBB38\uC81C\uC774\uAE30 \uB54C\uBB38\uC5D0 \uB9E4\uC6B0 \uC911\uC694\uD558\uB2E4.",
