  "text" : "\uC774\uB97C \uD1B5\uD574 \uC5BB\uC5B4\uC9C4 \uC5F0\uAD6C \uACB0\uACFC\uB97C \uBC14\uD0D5\uC73C\uB85C \uCCAD\uC18C\uB144\uB4E4\uC744 \uC704\uD55C \uBC94\uC8C4\uC608\uBC29 \uD504\uB85C\uADF8\uB7A8\uC744 \uC6B4\uC601\uD560 \uACC4\uD68D\uB3C4 \uAC16\uACE0 \uC788\uB2E4. \uC57D\uBB3C \uC911\uB3C5\uC5D0 \uAD00\uD55C \uC5F0\uAD6C\uB098 \uAC00\uC815\uBD88\uD654\uAC00 \uCCAD\uC18C\uB144\uC758 \uD589\uB3D9\uC5D0 \uBBF8\uCE58\uB294 \uC601\uD5A5\uC5D0 \uAD00\uD55C \uC5F0\uAD6C\uB3C4 \uC774 \uD504\uB85C\uC81D\uD2B8\uB97C \uCD94\uC9C4\uD558\uACE0 \uC788\uB294 \uC815\uBD80\uC758 \uC8FC\uC694 \uAD00\uC2EC\uC0AC\uB2E4.",
