  "text" : "\uAC8C\uB2E4\uAC00 \uC124\uB839 \uBC94\uC8C4\uC790\uAC00 \uAC10\uC625\uC5D0\uC11C \uCDA9\uBD84\uD788 \uBC18\uC131\uC758 \uC2DC\uAC04\uC744 \uAC00\uC84C\uB2E4\uACE0 \uD574\uB3C4, \uCD9C\uC18C \uD6C4 \uACAA\uC744 \uC0AC\uD68C\uC801 \uB0C9\uB2F4\uACFC \uC804\uACFC\uC790\uB77C\uB294 \uB099\uC778 \uD6A8\uACFC\uB294 \uADF8\uB4E4\uC744 \uB2E4\uC2DC \uBC94\uC8C4\uC758 \uAE38\uB85C \uB4E4\uC5B4\uC11C\uAC8C \uB9CC\uB4E4 \uAC00\uB2A5\uC131\uC774 \uB192\uB2E4. \uB2E4\uC2DC \uB9D0\uD574 \uC0AC\uD6C4\uC57D\uBC29\uBB38\uC774 \uC544\uB2CC \u2018\uBC94\uC8C4 \uC608\uBC29\u2019\uC744 \uC704\uD574 \uC880\uB354 \uADFC\uBCF8\uC801\uC778 \uB300\uCC45 \uB9C8\uB828\uC774",
