  "text" : "\uBC29\uBC95\uC774 \uB2A5\uC0AC\uB294 \uC544\uB2C8\uB2E4.\n\n\uADF8\uB9AC\uACE0 \uAC10\uC625\uC774 \u2018\uBC18\uC131\uACFC \uAD50\uD654\uC758 \uACF5\uAC04\u2019\uC774 \uC544\uB2C8\uB77C \uD53C\uD574\uC790\uC758 \uBCF5\uC218\uC2EC\uC744 \uCDA9\uC871\uC2DC\uD0A4\uAE30 \uC704\uD55C \u2018\uCCB4\uBC8C\uACFC \uACE0\uD1B5\uC758 \uACF5\uAC04\u2019\uC73C\uB85C \uBA38\uBB3C\uB7EC \uC788\uAC70\uB098, \uC624\uD788\uB824 \uBC94\uC8C4 \uAE30\uC220\uC744 \uC0C8\uB85C \uBC30\uC6B0\uB294 \u2018\uC7A0\uC7AC\uC801 \uBC94\uC8C4\uC790 \uC591\uC131\uC18C\u2019\uB85C \uC804\uB77D\uD55C \uACBD\uC6B0\uB3C4 \uC5C6\uC9C0 \uC54A\uB2E4.",
